<Paginator noOfPages={5} light />
<Paginator noOfPages={5} info />
<Paginator noOfPages={5} warning />
<Paginator noOfPages={5} danger />
<Paginator noOfPages={5} success />
`;

const declarativeCode = '<Paginator noOfPages={5} isControlled onChange={(...args) => console.log(...args)} />';

const eventsCode = '<Paginator noOfPages={5} onChange={(...args) => console.log(...args)} />';

const simpleCode = '<Typeahead suggestions={suggestions} />';

const sizeCode = '';

export {
  customThemeCode,
  declarativeCode,
  disabledCode,
  eventsCode,
  preSearchTermUse,
  simpleCode,
  sizeCode,
};
